import logo from './logo.svg';
import './App.css';
import Navigation from './Navigation'
import {Router,RouteRoutes,Link} from 'react-router-dom';
import Home from './Home'

function App() {
  return (
    <>
    <Router>
      <Navigation/>
      <Switch>
      <Route path="/" element={<Home/>}></Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
